import ReactDOM from "react-dom/client";
import { Link } from "react-router-dom"
// import App from "../App";

import React from 'react'

export default function Header() {
  return (
    <div className='header-div' imge style={{ 
      backgroundImage: 'url(https://www.jctropicals.us/wp-content/uploads/2021/02/jc-tropical-aloe-vera-leaf.png)',
      backgroundRepeat: 'no-repeat',
      backgroundPositionY: '40px',
      backgroundSize: 'cover',
      backgroundPosition: '40% 50%',
      minHeight: '170px'

  }}>
        <h1 className='header'>Skinteractions</h1>
        <Link className="nav-links" to="*">Home</Link>
        <Link className="nav-links" to="/upload">Upload A Routine</Link>
        {/* <Link classname="nav-links" to" */}
    </div>
  )
}
